import React from "react";
/*
 const AllPuppies = (props) => {
    return (
        <div>
            <h2>this works brother</h2>
            { props.puppies.map ((puppy) => {
                return `<img src="${puppy.imageUrl}" alt= "phoot"`

            })

            } 
        </div>
    );
};
*/
export default AllPuppies


 function AllPuppies (props) {
    let container = ''
     props.puppies.map ((puppy) => {
        let image = `<img src="${puppy.imageUrl}" alt= "phoot"`;
        container += image;
     } 

     ); return container;


}
